  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	id: 'projects',
	title: 'Contributions and Projects'
};
export const metadata = {
  "unversionedId": "projects",
  "id": "projects",
  "isDocsHomePage": false,
  "title": "Contributions and Projects",
  "description": "Theft Detection",
  "source": "@site/docs/projects.md",
  "permalink": "/projects"
};
  /* @jsx mdx */

export const rightToc = [{
  value: 'Theft Detection',
  id: 'theft-detection',
  children: []
}, {
  value: 'Face Mask Detector',
  id: 'face-mask-detector',
  children: []
}, {
  value: 'Weapon Detector',
  id: 'weapon-detector',
  children: []
}, {
  value: 'Image Captioning',
  id: 'image-captioning',
  children: []
}, {
  value: 'Emoji Predictor',
  id: 'emoji-predictor',
  children: []
}, {
  value: 'Face Detector',
  id: 'face-detector',
  children: []
}];

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h2 {...{
      "id": "theft-detection"
    }}>{`Theft Detection`}</h2>
    <p><a parentName="p" {...{
        "href": "https://github.com/jatinarora1/Theft-Detection"
      }}><inlineCode parentName="a">{`Theft-Detection`}</inlineCode></a>{` is an application which can detect 5 things which help in detecting suspicious activity.
The 5 features this application extract from the real-time video are mentioned below:`}</p>
    <p>{`1.) Motion Detection.`}</p>
    <p>{`2.) Facial Expression(if a person is not wearing a mask).`}</p>
    <p>{`3.) Mask Detection.`}</p>
    <p>{`4.) Weapon Detection.`}</p>
    <p>{`5.) It generates the caption of the activity that happened in the specific frame.`}</p>
    <p>{`Using these 5 features a machine learning model is trained which describes the type of activity that happened or going to have happened.`}</p>
    <h2 {...{
      "id": "face-mask-detector"
    }}>{`Face Mask Detector`}</h2>
    <p><a parentName="p" {...{
        "href": "https://github.com/jatinarora1/Face-Mask-Detector"
      }}><inlineCode parentName="a">{`Face-Mask-Detector`}</inlineCode></a>{` is a machine learning model capable to detect if a person is wearing masks or not with accuracy of 97.8%. This model is trained on 10,000 images and can be used in any kind of device whether mobile or desktop.`}</p>
    <h2 {...{
      "id": "weapon-detector"
    }}>{`Weapon Detector`}</h2>
    <p><a parentName="p" {...{
        "href": "https://github.com/jatinarora1/Weapon-Detector"
      }}><inlineCode parentName="a">{`Weapon-Detector`}</inlineCode></a>{` is a machine learning model capable to detect if a person is carrying a deadly weapon with him or not with accuracy of 98.8%. This model is trained on 12,000 images which contain different weapons held in different positions by people with different height and complection. This model can be used in any kind of device whether mobile or desktop. `}</p>
    <h2 {...{
      "id": "image-captioning"
    }}>{`Image Captioning`}</h2>
    <p><a parentName="p" {...{
        "href": "https://github.com/jatinarora1/Image-Captioning"
      }}><inlineCode parentName="a">{`Image-Captioning`}</inlineCode></a>{` is machine learning model which can predict the captions after processing the image provided to it. This model is has hybrid architecture of LSTM and CNN, where CNN is for image processing and LSTM is for text processing and generation. This model is trained on `}<inlineCode parentName="p">{`flickr32k`}</inlineCode>{` dataset and is 88% accurate.`}</p>
    <h2 {...{
      "id": "emoji-predictor"
    }}>{`Emoji Predictor`}</h2>
    <p>{`[`}<inlineCode parentName="p">{`Emoji Predictor`}</inlineCode>{`]`}{` is a machine learning model which predicts the specific emoji for the text provided to it. This model extracts the sentiments out of the text with 97.8% accuracy.`}</p>
    <h2 {...{
      "id": "face-detector"
    }}>{`Face Detector`}</h2>
    <p>{`[`}<inlineCode parentName="p">{`Face Detector`}</inlineCode>{`]`}{` is machine learning model which detects the face and gives the specific information stored with the detected face's person.`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
